    "monahrq",nt"isopen": true,nt"url": null,nt"notes": "<p>MONAHRQ is
    a downloadable desktop software tool from AHRQ.  It helps organizations easily generate
    a local healthcare reporting website.   To use MONAHRQ, you: -- download and install
    the MONAHRQ software -- input your data -- select website customization options
    -- let MONAHRQ generate your reporting website -- host the website yourself.   A
    MONAHRQ reporting website is searchable and user friendly.  It shows local healthcare
    information in tables, bar charts, and maps.   A MONAHRQ reporting website can show:
    -- hospital quality measures (AHRQ Quality Indicators, CMS Hospital Compare inpatient
    measures, and HCAHPS patient survey measures) -- hospital utilization and costs
    -- regional utilization and costs (default is by county) -- regional preventable
    hospitalizations and potential cost savings (default is by county). As input, MONAHRQ
    requires all or any of these: -- hospital administrative data -- precalculated CMS
    Hospital Compare measure results -- HCAHPS patient survey results For links to live
    public reporting websites generated using MONAHRQ, please visit <a href="http://www.monahrq.ahrq.gov/msites.shtml">http://www.monahrq.ahrq.gov/msites.shtml</a>.</p>n",nt"license_title":
